function PersonalZonePage({ authToken }) {

    return (
       <>
         <h1>Personal Zone</h1>
         {authToken ? (
           <>
             {/* Render additional navigation links or content for logged-in users here */}
           </>
         ) : (
           <p>Please log in to access this content.</p>
         )}
       </>
     );
  }
